import React, {Component} from 'react'

class App extends Component {
  state = {
    data: [],
  }

  // Code is invoked after the component is mounted/inserted into the DOM tree.
  componentDidMount() {
    const url =
      'https://reqres.in/api/users/'

    fetch(url)
      .then((result) => result.json())
      .then((result) => {
        this.setState({
          data: result,
        })
      })
  }

  render() {
    const {data} = this.state

      const result = data.map(user => {
        <tr key={user.Id}>
          <td>{user.Id}</td>
          </tr>
    })

    return <ul>{result}</ul>
    return <div><pre>{JSON.stringify(data.data, null, 2) }</pre></div>;


    //return <div><pre>{JSON.stringify(users.data, null, 2) }</pre></div>;
  }
}

export default App
